gentny, uczący się filtr, który zapobiega przedostawaniu się do skrzynki odbiorczej niechcianych wiadomości. Często to właśnie za ich pośrednictwem jest rozsyłane złośliwe oprogramowanie lub próby wyłudzenia pieniędzy przy pomocy phishingu. Antyzłodziej (Anti-Theft) – w przypadku kradzieży lub zgubienia urządzenia możesz zdalnie usunąć wszystkie dane – w tym listy kontaktów, wiadomości i dane z kart pamięci. Wystarczy, że wyślesz na telefon prostą komendę w postaci wiadomości SMS. Moduł Firewall i Antyspam dostępne tylko dla systemów Windows oraz Symbian. Funkcja Anti-Theft wsierana jest tylko przez smartfony.','','eset-security-pack-3user3smtf-12-miesiecy-esp-n3d1y-','','','','ESET Security Pack (3user+3smtf, 12-miesięcy) [ESP-N3D1Y]','',''),(15218,1,1,'Cena:  495zł 402,44zł netto Gwarancja producenta: 24 miesiące dostępne w magazynie - natychmiastowa wysyłka Przekątna ekranu: 24 cale Format ekranu :16:9 Typ panela LCD: TN Technologia podświetlenia: LED Rozdzielczość: 1920 x 1080 pikseli Czas reakcji matrycy: 1 ms Jasność: 250 cd/m2 Kontrast: 1000:1 Kąt widzenia poziomy: 170 stopni Kąt widzenia pionowy: 160 stopni Liczba kolorów: 16,7 mln Gniazda wejściowe: D-SUB, HDMI Głośniki: Nie Pivot: Nie Możliwość pochylenia (tilt): Tak Regulacja wysokości monitora: Nie Obrotowa podstawa: Nie Montaż na ścianie (VESA): Nie Szerokość: 569 mm Wysokość: 417 mm Głębokość: 197 mm Waga: 3,15 kg Kolor obudowy:czarny błyszczący','','samsung-s24d330hsx-1ms-hdmi-ls24d330hsx-en-','','','','Samsung S24D330HSX (1ms, HDMI) [LS24D330HSX/EN]','',''),(15274,1,1,'Cena:  539zł 438,21zł netto Gwarancja producenta: 24 miesiące dostępne w magazynie - natychmiastowa wysyłka Przekątna ekranu: 23,5 cale Format ekranu :16:9 Typ panela LCD: PLS Technologia podświetlenia: LED Rozdzielczość: 1920 x 1080 pikseli Czas reakcji matrycy: 4 ms Jasność: 250 cd/m2 Kontrast: 1000:1 Kąt widzenia poziomy: 178 stopni Kąt widzenia pionowy: 178 stopni Liczba kolorów: 16,7 mln Gniazda wejściowe: D-SUB, HDMI Głośniki: Ni