ogramowania. ESET NOD32 korzysta z opatentowanej technologii ThreatSense pozwalającej na wykrywanie i blokowanie nowych ataków w czasie rzeczywistym poprzez analizę zachowania badanego kodu. Dzięki temu NOD32 jest w stanie ochronić użytkownika przed nowym zagrożeniem, jeszcze zanim zostanie ono szczegółowo przeanalizowane w laboratorium producenta i zostanie stworzona odpowiednia sygnatura. Ochrona zapewniana jest przez następujące moduły: Antivirus Monitor (AMON) Rezydentny skaner na żądanie, analizując pliki automatycznie na zasadzie \"on-access\". NOD32 Skaner na żądanie, uruchamiany przez użytkownika sprawdzający wybrane pliki lub części dysku. Opcjonalnie może być uruchamiany automatycznie w czasie mniejszego obciążenia systemu. Internet MONitor (IMON) Skaner rezydujący w pamięci na poziomie Winsocka uniemożliwiający zainfekowanym plikom zapis na dysk. Skanuje wszystkie przeglądane strony internetowe (HTTP) oraz pocztę przychodzącą za pośrednictwem protokołu POP3. E-mail MONitor (EMON) Pomocniczy moduł skanujacy pocztę przychodzącą i wychodzącą poprzez interfejs MAPI, jak np. Microsoft Exchange. Document MONitor (DMON) Korzysta z Microsoft API w celu skanowania dokumentów MS Office (oraz Internet Explorera). Liczba stanowisk: 5 szt Wersja językowa: polska Wymagania systemowe: WIndows 95/98/ME/NT/2000/2003/XP/Vista Wymagania sprzętowe: Procesor K5 i wyższe , 30 MB na dysku twardym, 32 MB RAM','','eset-nod32-antivirus-5-user-24-miesiace','','','','ESET NOD32 Antivirus (5-user, 24-miesiące)','',''),(22737,1,1,'Cena:  119zł 96,75zł netto Korzystasz z kilku komputerów w domu lub firmie? Na smartfonie odbierasz pocztę i przeglądasz Internet? Teraz ESET przygotował rozwiązanie specjalnie dla Ciebie – ESET Security Pack. Pakiet programów którymi możesz chronić aż 3 komputery oraz 3 smartfony, niezależnie od tego czy korzystasz z nich w domu czy firmie. ESET Security Pack zapewnia kompleksową ochronę komputerów z systemami Windows, Linux, Mac OS X oraz urządzeń mobilnyc