wnikom zdalny dostęp do komputera użytkownika i jego prywatnych danych. Moduł antyspamowy – Wykorzystuje inteligentny, uczący się filtr, który zapobiega przedostawaniu się do skrzynki odbiorczej niechcianych wiadomości. Często to właśnie za ich pośrednictwem jest rozsyłane złośliwe oprogramowanie lub próby wyłudzenia pieniędzy przy pomocy phishingu. Antyzłodziej (Anti-Theft) – w przypadku kradzieży lub zgubienia urządzenia możesz zdalnie usunąć wszystkie dane – w tym listy kontaktów, wiadomości i dane z kart pamięci. Wystarczy, że wyślesz na telefon prostą komendę w postaci wiadomości SMS. Moduł Firewall i Antyspam dostępne tylko dla systemów Windows oraz Symbian. Funkcja Anti-Theft wsierana jest tylko przez smartfony.','','eset-security-pack-3user3smtf-24-miesiace-upgrade-esp-k3d2y-','','','','ESET Security Pack (3user+3smtf, 24-miesiące, upgrade) [ESP-K3D2Y]','',''),(33890,1,1,'Cena:  220zł 178,86zł netto Korzystasz z kilku komputerów w domu lub firmie? Na smartfonie odbierasz pocztę i przeglądasz Internet? Teraz ESET przygotował rozwiązanie specjalnie dla Ciebie – ESET Security Pack. Pakiet programów którymi możesz chronić aż 3 komputery oraz 3 smartfony, niezależnie od tego czy korzystasz z nich w domu czy firmie. ESET Security Pack zapewnia kompleksową ochronę komputerów z systemami Windows, Linux, Mac OS X oraz urządzeń mobilnych. Skorzystaj z ESET Security Pack i ciesz się pełną ochroną komputerów i samartfonów zarówno w domu jak i w firmie. Najważniejsze funkcje ESET Security Pack Skaner antywirusowy ThreatSense® – Autorska technologia ESET chroniąca przez znanymi jak i nowymi typami zagrożeń. Zapewnia pełne bezpieczeństwo podczas korzystania z Internetu oraz codziennej pracy na komputerze. Antyspyware – Ochrona przed złośliwym oprogramowaniem śledzącym aktywność użytkownika online. Chroni przed kradzieżą danych i poufnych informacji z komputera. Zapora osobista (Firewall) – Uniemożliwia niepowołanym użytkownikom zdalny dostęp do komputera użytkownika i jego